void bubbleSort(int vetor[], int tamanho) {      
    int flag, i, aux;   
    
    do{
      flag = 0;
      for (i = 0; i < (tamanho - 1); i++) {
		   if (vetor[i] > vetor[i+1]) {
		     aux = vetor[i];
		     vetor[i] = vetor[i+1];
		     vetor[i+1] = aux;
		     flag = 1;
		   	}
   		}
    }while (flag == 1);
    
    FILE *fptr;
	fptr = fopen("PosCrescenteDecrescente.txt", "w");
   	for(i = 0; i < tamanho;i++){
   		fprintf(fptr, "%d, ", vetor[i]);
   	}
   	
	fclose(fptr);
}
